import React, { Component } from 'react';
import Sidebar from "../Navigation/Sidebar/Sidebar"
import TopBar from "../Navigation/Topbar";
import "./layout.scss"

class layout extends Component {

    render() {
        return (
            <div className="page-wrapper">
                <TopBar />
                <Sidebar show />
                { this.props.children }
            </div>
        );
    }
}

export default layout;
